import React from "react";
import { NavLink, Link } from "react-router-dom";
import "aos/dist/aos.css";
import Aos from "aos";
import "./liveSessions.css";
import { ClientRequest } from "http";

class LiveSessions extends React.Component {
  render() {
    Aos.init();
    return (
       
            <div className="card card-align"
            data-aos="fade-up"
            data-aos-delay="1000"
            data-aos-duration="2000"
             >  
            <span
              className="card text-black bg-light  border-dark"
              style={{ alignitems: "center", width: 180, height: 220 }}
            >
              <h2 className="title" style={{ textAlign: "center" }}>
                <Link to="" style={{ textDecoration: "none" }}>
                  <p style={{ color: "red" }}>Become an opportunist</p>
                </Link>
              </h2>
            </span>
                </div>
              
          );
        }
      }



export default LiveSessions;
